■商品特徴<br>
価格重視のエントリーモデル<br>
ネット・メール使用がメインのあなたへ<br>
<font size="3"><p>SSD Windows10 アップグレードオプションはこちら</p></font><br>
■商品詳細<br>
商品区分:中古ノートパソコン<br>
メーカ：メーカ不定 富士通 NEC等<br>
機種名・型番:シリーズなど メーカ不定<br>
OS：Windows7 32bit(Home or Pro)<br>
CPU：Celeron、Core2Duo以上<br>
メモリ：1GB以上<br>
ハードディスク：80GB以上<br>
光学ドライブ：DVD-ROM以上<br>
画面サイズ：14インチ以上<br>
無線LAN：-<br>
その他:仕様・型番の指定はお受け致しかねます。<br>
Officeソフト:OpenOffice<br>
付属品：電源コード<br>
※その他ページに記載の無いものは付属していません。<br>
<font size="3" color="#FF0000">保証：3年</font><br>
<br>
■商品に関して<br>
本商品は弊社にてメモリ・HDD・光学ドライブ等の部品の換装を行い、
OSの再インストール、清掃作業を行ったPC-Xオリジナルの商品でございます。<br>

在庫切れの際は近似した性能の商品を補充致しますが、
外装・CPUに関しては弊社にての換装・改造が規約により不可能な為、
外装使用メーカー・機種は入荷状況を踏まえた最良の物に変更される可能性がございます。<br>
（現在庫に関しましては表示機種・表示性能で納品が可能です）<br>

■商品レビューに関して<br>
本商品は当店で部品の換装を施したオリジナルパソコンであり、 商品レビューの内容が違うメーカー、性能の場合がございます。
現在掲載中の商品写真と異なる商品をお届けする場合、事前にお客様に了承を確認いたします。<br>

■本商品に使用する予定のメーカー<br>
NEC、富士通、東芝、日立、Panasonic、EPSON、SONY
HP、IBM、lenovo、DELL<br>

■本商品で換装使用する予定の部品<br>
メモリ：512MB～4096MB<br>
HDD：40GB～1024GB<br>
